  var firebaseConfig = {
    apiKey: 'AIzaSyBmMQzZDPK8WoRFsXZwEikglgPh8fdbRfU',
    authDomain: 'moonlit-premise-268014.firebaseapp.com',
    databaseURL: 'https://project-483449585526.firebaseio.com',
    projectId: 'moonlit-premise-268014'
  }

  if (!firebase.apps.length) {
    firebase.initializeApp(firebaseConfig)
  }


  const Stack = createStackNavigator();
  
  return (
  <NavigationContainer><Stack.Navigator initialRouteName="SignIn"><Stack.Screen name="SoilSense" component={SoilSense} /><Stack.Screen name="SignIn" component={SignIn} /><Stack.Screen name="SignUp" component={SignUp} /><Stack.Screen name="Temperature" component={TemperatureLevel} /><Stack.Screen name="HumidityLevel" component={HumidityLevel} /><Stack.Screen name="LightingLevel" component={LightingLevel} /><Stack.Screen name="MaxWaterValue" component={MaxWaterLevel} /><Stack.Screen name="SensorLocation" component={SensorLocation} /><Stack.Screen name="WaterPump" component={WaterPump} />{/* <Stack.Screen name="CurrencyFormatting" component={CurrencyFormatting} /> */}</Stack.Navigator></NavigationContainer>)
}

const styles = StyleSheet.create({
  container: {
    display: 'flex',
    flexDirection: 'column',
  },
})

export default App
